import Vue from "vue";
import VueRouter from "vue-router";
import router from "@/router/index.js";
import App from "@/App.vue";
Vue.config.productTip=false;
Vue.use(VueRouter);


new Vue({
  render: h =>h(App),
  router
}).$mount('#app')
